const CashCropsPage = () => {
  return (
    <div className="fertilizer-page">
     
      {/* <header className="navbar">
        <div className="logo"><img src="/images/logo.png" alt="AgroPrime" /></div>
        <nav>
          <ul>
            <li className="active">Home</li>
            <li>About</li>
            <li>Information</li>
            <li>Blog</li>
            <li>Shop</li>
            <li>Contact</li>
            <li>Login</li>
          </ul>
        </nav>
      </header> */}

      <div className="category-header">
        <span className="back-arrow"><Link to="/Agroproducts" >✕</Link></span>
        <button className="active-tab">Cash Crops</button>
      </div>
       <Navbar/>

      <div className="product-grid">
        {products.map((item, i) => (
          <div className="product-card" key={i}>
            <img src={item.image} alt={item.name} />
            <h4>{item.name}</h4>
            <p className="desc">{item.description}</p>
            <p className="price"><i>{item.price}</i> <span> / {item.unit}</span></p>
            <button className="buy-btn">Buy now</button>
          </div>
        ))}
      </div>

      <footer>
        <div>2025 AgroPrime</div>
        <div className="social-links">
          <a href="#">Facebook</a> |
          <a href="#">Instagram</a> |
          <a href="#">Youtube</a>
        </div>
      </footer>
    </div>
  );
};

export default CashCropsPage;
